import React from "react";
import Navbar_rating from "../single_comps/ratingPageComps/Navbar_rating";

const TopDiv = styled.div`
  width: 100%;
  height: 800px;
  overflow: hidden;
`;
function RatingPage() {
  return (
    <div style={{ overflowY: "hidden" }}>
      <TopDiv>
        <Navbar_rating />
      </TopDiv>
    </div>
  );
}

export default RatingPage;
